import './App.css';
import UilReact from '@iconscout/react-unicons/icons/uil-react'

function App() {
  return (
    <div className="App">
      <h1 className="text-2xl font-bold font bg-red-500 text-blue-400 ">Hello World</h1>
      <UilReact size={50}/>
    </div>
  );
}

export default App;
